import React from 'react';
import'./About.css'

const About = () => {
    return (
        <div className="about">
            <h2 style={{textAlign:'center'}}>About Us</h2>
           <div className="px-4 mx-4">
               <p className="px-4 mx-4">Health is a key factor of normal life of any person. We cannot perform wholesome physical and mental activity without good health. Each separate medical institution is a treatment oasis of many diseases. Our team decided to create a modern Life care UI, where people could easily find the right specialist to get an online consultation or to make an appointment using website built-in tools.We tried to implement the main controls of any website in terms of medical </p>
           </div>
        </div>
    );
};

export default About;
